import React from 'react'
import Xarrow from "react-xarrows";

const DrawArrows = (props) => {
   
const renderXarrow = () =>{

    let xarrow = [];

    for(let arrow = 0; arrow <props.length;arrow++){

        if(children[arrow].next!=null){
            xarrow.push(
                <Xarrow
                    start={children[arrow].index} 
                    end= {children[arrow].next}
                />
            )
        }
    }

    return xarrow;

}

return renderXarrow();

};

export default DrawArrows;
